import React from 'react';
import Navigate from './navigate';
import Link from 'next/link';
import './nav.css';

const Nav = () => (
  <header className="page-header">
    <nav>
      <Link href="/">
        <a href="/">index</a>
      </Link>
      <Link href="/page-two">
        <a>page-two</a>
      </Link>
      <Link href="/page-three">
        <a>page-three</a>
      </Link>
    </nav>
  </header>
);

export default Nav;
